import React from 'react';
import {Swiper, SwiperSlide} from 'swiper/react';
import SwiperCore, {Navigation} from 'swiper';
import 'swiper/swiper-bundle.css';
import './DiagnosticsSlider1.css';

SwiperCore.use([Navigation]);



function DiagnosticsSlider1() {
    return (
        <div>
            <Swiper navigation slidesPerView={5}>
                <SwiperSlide className="DiagnosticsSlider1-container">
                    <div className="DiagnosticsSlide1"></div>
                </SwiperSlide>
            </Swiper>
        </div>
    )
}

export default DiagnosticsSlider1;
